import React from 'react';

import './Topbar.scss';

import { Link } from "react-router-dom";

import { Logo } from "../../components";

const Topbar = () => (
    <header className="topbar"  data-testid="topbar">
        <div className="container">
            <Link to="/dashboard">
                <Logo></Logo>
            </Link>
        </div>
    </header>);

export default Topbar;
